import React from 'react';

const MovieList = ({ movies, onMovieSelect }) => {
  return (
    <div>
      {movies.map((movie) => (
        <div key={movie.imdbID} onClick={() => onMovieSelect(movie)}>
          <h3>{movie.Title}</h3>
          <img src={movie.Poster} alt={movie.Title} />
        </div>
      ))}
    </div>
  );
};

export default MovieList;
